    def init_request(self):
        """Run this to login before crawling"""
        
        return Request(url=self.login_page, callback=self.login)

    def login(self, response):
        """Generate a login request"""
        return FormRequest.from_response(response,
            formdata={'name': 'David Charles', 'pass': 'cSp$1103'},
            callback=self.after_login
            )

    def after_login(self, response):
        # check login succeed before going on
        if "Welcome to CSPedia" in response.body:
            self.log("\n\n\nSuccessfully logged in.\n\n\n")
            self.initialized()
            return Request(url="http://www.cspedia.net/people/employees/private/sarah-acevedo",
               callback=self.parse_item)
        else:
            self.log("Login failed", level=log.ERROR)

    def parse_item(self, response):
        # open_in_browser(response)
        sel = Selector(response)
        fields = sel.xpath('//body')
        items =[]
        for field in fields:
            item = CspediaScraperItem()
            item['name'] = field.css('div.employee_content h5::text').extract()
            item['title'] = field.css('div.employee_content ul li:first-child::text').extract()
            item['categoriesOfResponsibilities'] = field.css('div.employee_content ul li:nth-child(2)::text').extract()
            item['phone'] = field.css('div.employee_content ul li:nth-child(3)::text').extract()
            item['email'] = field.css('div.employee_content a::attr(href)').extract()
            #These may not always return the right values if a member profile does not have all fields filled out
            item['company'] = field.css('div#content_footer div.views-field-title-1 span.field-content a::text').extract()
            item['address1'] = field.css('div#content_footer div.views-field-field-company-address-1-value span.field-content::text').extract()
            item['address2'] = field.css('div#content_footer div.views-field-field-company-address-2-value span.field-content::text').extract()
            item['city'] = field.css('div#content_footer div.views-field-field-company-city-value span.field-content::text').extract()
            item['state'] = field.css('div#content_footer div.views-field-field-state-province-value span.field-content::text').extract()
            item['postalCode'] = field.css('div#content_footer div.views-field-field-company-postal-code-value span.field-content::text').extract()
            item['country'] = field.css('div#content_footer div.views-field-field-company-country-value span.field-content::text').extract()
            items.append(item)

        return items